import React, { useContext, useState } from 'react'
import './Navigationitems.css'
import Navigationitem from './Navigationitem/Navigationitem'
import { logoutButton , userName } from '../../../../Authentication'
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';
const NavigationItems = () => {
    const logout=useContext(logoutButton)
    const name=useContext(userName)
    const [Hide,setHide]=useState(false)
    const handlerHide=()=>{
        setHide(true)
    }
    return (
        <div >
            <ul className="Navigationitems">
         <Navigationitem link="/">Burger Builder</Navigationitem>
         <Navigationitem link="/orders">Orders</Navigationitem>
       <div class="dropdown">
  <button onClick={handlerHide} class="userName dropdown-toggle" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false">
  {name}
  </button>
  {Hide?<p className='logout'>Logout</p>:null}
  
</div>
            </ul>
        </div>
    )
}

export default NavigationItems
